    //暴力法
    public String longestDupSubstring2(String s) {
        Set<String> subStr = new HashSet<>();
        int len = s.length();
        for (int i = len; i >= 1; --i) {
            for (int j = 0; j + i <= len; ++j) {
                String substring = s.substring(j, j + i);
                if (subStr.contains(substring)) {
                    return substring;
                }
                subStr.add(substring);
            }
        }
        return "";
    }

    public static final long PRIME2 = 31;

    public String longestDupSubstring(String s) {
        String ans = "";
        int l = 0, r = s.length() - 1;
        while (l <= r) {
            //mid是我要找的长度
            int mid = (l + r + 1) / 2;
            //看看能否找得到这么长的字符串
            String x = find(s, mid);
            if (!x.equals("")) {
                //找到了在看更长的字串，更短的就不用看了
                l = mid + 1;
                ans = x;
            } else {
                //没有找到就看更短的字符串
                r = mid - 1;
            }
        }
        return ans;
    }

    public String find(String s, int len) {
        String ans = "";
        Set<Long> set = new HashSet<>();
        long hash = 0;
        long power = 1;
        //先计算前len个组成的字串的hash
        for (int i = 0; i < len; ++i) {
            hash = hash * PRIME2 + s.charAt(i);
            power *= PRIME2;
        }
        set.add(hash);

        // 滑动窗口向后移，每次移动要把移出窗口的减去，再加上新的
        for (int i = len; i < s.length(); i++) {
            hash = hash * PRIME2 + s.charAt(i) - power * s.charAt(i - len);
            // 如果包含相同的hash说明之前可能出现过相同的子串
            // 再检测一下从头查找相同的子串，它的位置不是当前 i 的位置，说明确实是相同的子串
            // 否则，可能是因为hash冲突导致的误判
            // 针对本题，不加indexOf这个判断也可以过，是因为没有出现这样的用例
            // 但是，为了逻辑更严谨，还是应该加上这个判断
            if (set.contains(hash) && s.indexOf(ans = s.substring(i - len + 1, i + 1)) != i) {
                return ans;
            }
            set.add(hash);
        }

        return ans;
    }


    public static final long R = 31;//因为s只右26个小写字母构成，所以进制数选26
    //public static final long PRIME = 1313131;//取一个比较大的质数，防止hash溢出

    public String longestDupSubstring3(String s) {
        //利用二分来查找能找都重复子串的最大长度
        //如果一个长度mid可以查到重复字串，则长度<mid的必定有重复字串，长度大于mid的不一定有
        // 所以 要增大长度，看看还能不能找得到重复子串
        //如果一个长度mid不可以查到重复子串。则，长度大于mid永远不可能找到重复子串，此时应该缩小长度
        int l = 0, r = s.length()-1;
        String result = "";
        while (l <= r) {
            int mid = (l + r + 1) / 2;
            String ans = check(s, mid);
            if (ans.equals("")) {//没找到,长度缩小
                r = mid - 1;
            } else {//找到了长度增大
                result = ans;
                l = mid + 1;
            }
        }
        return result;
    }

    private String check(String s, int len) {
        String ans = "";
        long H = 1;
        for (int i = 0; i < len - 1; i++) {
            //计算当前长度下 最高位的权重
            //H = (H * R) % PRIME;//17576
            H = H * R;
        }
        //计算开始的len字符串的hash值
        long hash = 0;
        for (int i = 0; i < len; ++i) {
            hash = (long) (hash * R + s.charAt(i));
        }
        //建立一个存放hash的set
        Set<Long> set = new HashSet<>();
        set.add(hash);
        for (int i = len; i < s.length(); ++i) {
            hash = (hash - s.charAt(i - len) * H) * R + s.charAt(i);
            if (set.contains(hash)) {
                //hash值相等 还需要判断两个字符串是否一样
                ans = s.substring(i - len + 1, i + 1);
                int index = s.indexOf(ans);
                if (index != i) {
                    return ans;
                }
            }
            //hash值不等就加入set
            set.add(hash);
        }
        return ans;
    }

